?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Одна из наиболее известных марок на современном часовом рынке была основана более, чем 130 лет назад. В 1881 году Хаттори принимает решение об открытии собственного магазина ювелирных изделий и часов. Начиная с 1892 года, он решает сам наладить производство часов. Бренд решено было назвать Seikosha. Первые часы, произведенные под маркой Seiko, были выпущены в 1924 году. Но настоящий фурор среди часового сообщества, компания Seiko произвела в 1973 году, когда выпустила первые в мире часы с жидкокристаллическим дисплеем. На данный момент, в ассортименте компании насчитывается более 50-ти коллекций часов: начиная со спортивных, и заканчивая высокотехнологичными. Но абсолютно все экземпляры часов Seiko имеют и сходства: надежные и высококачественные механизмы, обеспечивающие долгосрочную работу часов, многочисленные современные функции, доступная цена. Все эти характеристики и дают огромную популярность часам Seiko.</span></span></p>
 
